package code

import (
	"encoding/hex"
	"reflect"
	"testing"
)

func TestParseContractMethods(t *testing.T) {
	code, err := hex.DecodeString("")
	if err != nil {
		t.Fatal(err)
	}
	methods, err := ParseContractMethods(code)
	if err != nil {
		t.Fatal(err)
	}
	expected := []int64{0, 4, 5, 6, 68445, 85719, 92067, 102491}
	if !reflect.DeepEqual(expected, methods) {
		t.Errorf("want: %v, got: %v", expected, methods)
	}
}
